import './index.css';

export default function Calendar({value, onDateChange}) {
  return (
    <div className="calendar">
      <label htmlFor='calendar'>Выберите дату:</label>
<input type="date" name="calendar" value={value} onChange={e => onDateChange(e.target.value)}/>
    </div>
  );
}
